import React, { useState } from 'react';

const Contact = (props) => {
    const [error,setError] = useState("")
    const contact_send = (e) => {
        e.preventDefault();
    }
    return (
        <div>
            
          <form action="" className="formclassName">
            <div className="formrow me-2">
              <input id="in1" type="text" name='objet' className="inputform" placeholder=" " required/>
              <label for="in1" className="labelform">Titre*</label> 
            </div>
            <div className="formrow ms-2">
              <textarea id="in2" type="text" name='message' className="inputform" placeholder=" " required/>
              <label for="in2" className="labelform">Message*</label> 
            </div>
          <div className="formrow w-100">
            <input id="in3" type="email" name='email' className="inputform" placeholder=" " required/>
            <label for="in3" className="labelform">Email*</label> 
          </div>
          <div className="d-flex justify-content-between align-items-center w-100">
            <div className="formrow ">
              <input id="in4" type="file" name='fichier' className="inputform " placeholder=" "/>
              <label for="in4" className="labelform">Fichier</label> 
            </div>
          </div>

          <p className="text-danger">
              {error}
          </p>
          <button className="formbtn" onClick={(e) => contact_send(e)}>
            Envoyer
          </button>
        </form>
        </div>
    );
}

export default Contact;
